  summary: Pack O Unreleased Booty
  description: |-
    Here's a large pack of models i made, for my  former CJ Pridnestrova , some are nightlighted, some are not. Don't even bother asking which, because frankly i don't remember.

    There are quite a few of these, and i damned well just barely managed to make this under 10 mb.

    Due to the limit of pics for the props i also included some extras in the zip. all JPG of course.

    All these models are released as props. And could be handy for anyone making East European or even asian cities.

    Enjoy. And remember, these BATs were never intended to release. So don't expect no bixel quality here.

    None of these props will either be used as dependencies for my own . Don't ask for growables, don't ask for lots. and if you have the know how to make growables; Feel free to release the lots, but NOT the models.
